import Link from 'next/link';
import goBackStyles from './goBack.module.scss';

const GoBack = ({ city }) => {
  return (
    <div className={goBackStyles.container}>
      <Link href={`/city/weather?city=${city}`}><a className={goBackStyles.back}>&#8592; Go back</a></Link>
      <p><span>&deg;C</span> | <span>&deg;F</span></p>
    </div>
  )
}

export default GoBack;
